INSERT INTO `authors` (`author_id`, `first_name`, `middle_name`, `last_name`, `born`, `died`, `photo`, `biography`) VALUES
(1, 'Agatha', NULL, 'Christie', '1890-09-15', '1976-01-12', , 'Dame Agatha Mary Clarissa Christie is the best-selling author of all time. She wrote 66 crime novels and story collections, fourteen plays, and six novels under a pseudonym in Romance. Her books have sold over a billion copies in the English language and a billion in translation. According to Index Translationum, she remains the most-translated individual author, having been translated into at least 103 languages. She is the creator of two of the most enduring figures in crime literature-Hercule Poirot and Miss Jane Marple-and author of The Mousetrap, the longest-running play in the history of modern theatre.\n\nAgatha Mary Clarissa Miller was born in Torquay, Devon, England, U.K., as the youngest of three. The Millers had two other children: Margaret Frary Miller (18791950), called Madge, who was eleven years Agatha\'s senior, and Louis Montant Miller (18801929), called Monty, ten years older than Agatha.');
INSERT INTO `authors` (`author_id`, `first_name`, `middle_name`, `last_name`, `born`, `died`, `photo`, `biography`) VALUES
(2, 'Dan', NULL, 'Simmons', '1947-04-04', NULL, , 'Dan Simmons grew up in various cities and small towns in the Midwest, including Brimfield, Illinois, which was the source of his fictional \"Elm Haven\" in 1991\'s SUMMER OF NIGHT and 2002\'s A WINTER HAUNTING. Dan received a B.A. in English from Wabash College in 1970, winning a national Phi Beta Kappa Award during his senior year for excellence in fiction, journalism and art.\n\nDan received his Masters in Education from Washington University in St. Louis in 1971. He then worked in elementary education for 18 years2 years in Missouri, 2 years in Buffalo, New Yorkone year as a specially trained BOCES \"resource teacher\" and another as a sixth-grade teacherand 14 years in Colorado.');
